import './App.css';
import Dictionary from "./Dictionary";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <img src="./book-logo.png" alt="logo"/>
      </header>
        <main>
            <Dictionary />
        </main>
    </div>
  );
}

export default App;
